//Advent of Code
//Day 5.1
const input = '';

const unitsLeft = str => {
	//loops through string
	for (let i = 0; i < str.length - 1; i++) {
	 	const firstChar = str[i];
	 	const secondChar = str[i + 1];

	 	if (firstChar === secondChar) continue;
	 	if (firstChar.toLowerCase() === secondChar || firstChar.toUpperCase() === secondChar) {
	 		str = str.slice(0, i) + str.slice (i + 2);
	 		if (i === 0) i = -1;
	 		else i -= 2;
	 	}
	 }

	 return str.length;
}

const result = unitsLeft(input);
console.log(result);

/*
Explanation: Part 1

Line 6: It loops to the string length - 1, because we're comparing the current character and the next one in each round.
Line 10: Check if the characters match first before we check if they match with the case changes. We move on if they match.
Line 11: If they don't match, then we can check if they match when the cases are changed.
Line 12: If so, then we remove the pair from the current string.
Line 13: If it's at the beginning, then we need to make sure that i doesn't get smaller than 0.
Line 14: Otherwise, we reduce i by 2, so that we can go back to the previous character to see if the characters before and after the pair we just removed match.
Line 15: Don't need another statement for the case that the characters don't match at all. 
*/

//Day 5.2
const improvedPolymer = str => {
	const alphabet = 'AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz';
	let shortestLength = result;

	for (let i = 0; i < 26; i += 2) {
	 	const currUpper = alphabet[i];
	 	const currLower = alphabet[i + 1];
	 	const cleanStr = str.split(currUpper).join('').split(currLower).join('');
	 	const currLength = unitsLeft(cleanStr);

	 	if (currLength < shortestLength) shortestLength = currLength;
	 }

	 return shortestLength;
}

const result2 = improvedPolymer(input);
console.log(result2);

